import React from 'react'

async function getSummonerId(api_key) {
    const api_url = "https://na1.api.riotgames.com/lol/summoner/v4/summoners/by-name/Mateo?api_key=" + api_key
    const fetch_response = await fetch(api_url)
    const json = await fetch_response.json()
}
